// src/App.js

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import UserDetailsAxios from './components/UserDetailsAxios';  

function App() {
  return (

<Router>
    <Routes>
      <Route path="/users/:userId" element={<UserDetailsAxios />} />
    </Routes>
</Router>


  );
}

export default App;
